import React, {useState, useEffect} from "react";
import "../styles/travelagencies.css";
import LocationCard from "../shared/LocationCard";
import CommonSection from "../shared/travelagencie/CommonSection-travelagencie";
import SearchBar from "../shared/SearchBar";
import { Col, Container, Row } from "reactstrap";
import travelData from "../assets/data/travelagencies";
const TravelAgencies = () => {
    const [pageCount, SetPageCount] = useState(0)
    const [page, setPage] = useState(0)

    useEffect(()=>{
        const pages = Math.ceil(5/ 4)
        SetPageCount(pages)
    },[page])
    return (
     <>
    <CommonSection title={"All Travel Agencies"} />
    <section>
        <Container>
            <Row>
                <SearchBar />
            </Row>
        </Container>
    </section>
    <section>
        <Container>
            <Row>
                {
                    travelData?.map(location => <Col lg="3" key={location.id}> <LocationCard location={location} /></Col>)

                }
            </Row>
        </Container>
    </section>
    </>
    )
};
export default TravelAgencies;
